// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract DonationContract {
    // Bağışçı bilgilerini tutan struct
    struct Donor {
        uint256 amount;
        bool exists;
    }

    // Bağışçı adreslerini bağış bilgileriyle eşleştiren mapping
    mapping(address => Donor) public donors;

    // Toplam toplanan bağış miktarı
    uint256 public totalDonations;

    // Etkinlik: Yeni bir bağış alındığında tetiklenir
    event DonationReceived(address indexed donor, uint256 amount);

    // Bağış yapma işlemi
    function donate() external payable {
        require(msg.value > 0, "Amount must be greater than 0");

        // Bağışçının daha önce bağış yapmadığını kontrol et
        if (!donors[msg.sender].exists) {
            donors[msg.sender] = Donor({
                amount: msg.value,
                exists: true
            });
        } else {
            donors[msg.sender].amount += msg.value;
        }

        totalDonations += msg.value;

        emit DonationReceived(msg.sender, msg.value);
    }

    // Contract'taki toplam bağış miktarını görüntüleme fonksiyonu
    function getTotalDonations() external view returns (uint256) {
        return totalDonations;
    }

    // Contract'taki bağışçıların bağış miktarlarını görüntüleme fonksiyonu
    function getDonorAmount(address donorAddress) external view returns (uint256) {
        return donors[donorAddress].amount;
    }
}

